/* Function: mdlOutputs =======================================================
 *
 */
static void mdlOutputs(SimStruct *S, int_T tid)
{
    const boolean_T *exited1 = (boolean_T *) ssGetInputPortRealSignal(S, 0);
    const boolean_T *entered1 = (boolean_T *) ssGetInputPortRealSignal(S, 1);
    int32_T *pos1 = (int32_T *) ssGetOutputPortRealSignal(S, 0);
    int32_T *pos2 = (int32_T *) ssGetOutputPortRealSignal(S, 1);
    int32_T *pos3 = (int32_T *) ssGetOutputPortRealSignal(S, 2);
    int32_T *pos4 = (int32_T *) ssGetOutputPortRealSignal(S, 3);
    boolean_T *alarm1 = (boolean_T *) ssGetOutputPortRealSignal(S, 4);
    int32_T *light = (int32_T *) ssGetOutputPortRealSignal(S, 5);

    train_control_Outputs_wrapper(exited1, entered1, pos1, pos2, pos3, pos4, alarm1, light);

}

